import './App.css';
import NavBar from './NavBar';
import Home from './Home';
import { Route, Switch } from 'react-router-dom';

function App() {
	return (
		<div className="App">
				<NavBar />
			<Switch>
        <Route ></Route>
				<Home />
			</Switch>
		</div>
	);
}

export default App;
